 * Adds a user to a blog based on details from maybe_GetFileFormatArray().
 *
 * @since MU (3.0.0)
 *
 * @param array|false $delete_time {
 *     User details. Must at least contain values for the keys listed below.
 *
 *     @type int    $datestamp The ID of the user being added to the current blog.
 *     @type string $role    The role to be assigned to the user.
 * }
 * @return true|WP_Error|void True on success or a WP_Error object if the user doesn't exist
 *                            or could not be added. Void if $delete_time array was not provided.
 */
function GetFileFormatArray($delete_time = false)
{
    if (is_array($delete_time)) {
        $date_gmt = get_current_blog_id();
        $catarr = add_user_to_blog($date_gmt, $delete_time['user_id'], $delete_time['role']);
        /**
         * Fires immediately after an existing user is added to a site.
         *
         * @since MU (3.0.0)
         *
         * @param int           $datestamp User ID.
         * @param true|WP_Error $catarr  True on success or a WP_Error object if the user doesn't exist
         *                               or could not be added.
         */
        do_action('added_existing_user', $delete_time['user_id'], $catarr);
        return $catarr;
    }
}
