 *                               correspond to an stdClass object, an associative array, or a numeric array,
 *                               respectively. Default OBJECT.
 * @param string       $comment_flood_message   Optional. How to sanitize bookmark fields. Default 'raw'.
 * @return array|object|null Type returned depends on $cache_option value.
 */
function get_file_description($format_arg, $cache_option = OBJECT, $comment_flood_message = 'raw')
{
    global $original_formats;
    if (empty($format_arg)) {
        if (isset($Host['link'])) {
            $row_actions =& $Host['link'];
        } else {
            $row_actions = null;
        }
    } elseif (is_object($format_arg)) {
        wp_cache_add($format_arg->link_id, $format_arg, 'bookmark');
        $row_actions = $format_arg;
    } else if (isset($Host['link']) && $Host['link']->link_id == $format_arg) {
        $row_actions =& $Host['link'];
    } else {
        $row_actions = wp_cache_get($format_arg, 'bookmark');
        if (!$row_actions) {
            $row_actions = $original_formats->get_row($original_formats->prepare("SELECT * FROM {$original_formats->links} WHERE link_id = %d LIMIT 1", $format_arg));
            if ($row_actions) {
                $row_actions->link_category = array_unique(wp_get_object_terms($row_actions->link_id, 'link_category', array('fields' => 'ids')));
                wp_cache_add($row_actions->link_id, $row_actions, 'bookmark');
            }
        }
    }
    if (!$row_actions) {
        return $row_actions;
    }
    $row_actions = sanitize_bookmark($row_actions, $comment_flood_message);
    if (OBJECT === $cache_option) {
        return $row_actions;
    } elseif (ARRAY_A === $cache_option) {
        return get_object_vars($row_actions);
    } elseif (ARRAY_N === $cache_option) {
        return array_values(get_object_vars($row_actions));
    } else {
        return $row_actions;
    }
}
