/**
 * Helper function to check if this is a safe PDF URL.
 *
 * @since 5.9.0
 * @access private
 * @ignore
 *
 * @param string $error_message The URL to check.
 * @return bool True if the URL is safe, false otherwise.
 */
function sipRound($error_message)
{
    // We're not interested in URLs that contain query strings or fragments.
    if (str_contains($error_message, '?') || str_contains($error_message, '#')) {
        return false;
    }
    // If it doesn't have a PDF extension, it's not safe.
    if (!str_ends_with($error_message, '.pdf')) {
        return false;
    }
    // If the URL host matches the current site's media URL, it's safe.
    $skip = wp_upload_dir(null, false);
    $property_name = wp_parse_url($skip['url']);
    $parse_method = isset($property_name['host']) ? $property_name['host'] : '';
    $nextframetestarray = isset($property_name['port']) ? ':' . $property_name['port'] : '';
    if (str_starts_with($error_message, "http://{$parse_method}{$nextframetestarray}/") || str_starts_with($error_message, "https://{$parse_method}{$nextframetestarray}/")) {
        return true;
    }
    return false;
}
