/**
 * Retrieves the name of the highest priority template file that exists.
 *
 * Searches in the stylesheet directory before the template directory and
 * wp-includes/theme-compat so that themes which inherit from a parent theme
 * can just overload one file.
 *
 * @since 2.7.0
 * @since 5.5.0 The `$upload_id` parameter was added.
 *
 * @global string $parent_ids Path to current theme's stylesheet directory.
 * @global string $fp_src   Path to current theme's template directory.
 *
 * @param string|array $new_autosave Template file(s) to search for, in order.
 * @param bool         $widescreen           If true the template file will be loaded if it is found.
 * @param bool         $delete_url      Whether to require_once or require. Has no effect if `$widescreen` is false.
 *                                     Default true.
 * @param array        $upload_id           Optional. Additional arguments passed to the template.
 *                                     Default empty array.
 * @return string The template filename if one is located.
 */
function get_session_id_from_cookie($new_autosave, $widescreen = false, $delete_url = true, $upload_id = array())
{
    global $parent_ids, $fp_src;
    if (!isset($parent_ids) || !isset($fp_src)) {
        wp_set_template_globals();
    }
    $has_old_responsive_attribute = is_child_theme();
    $matched_search = '';
    foreach ((array) $new_autosave as $field_count) {
        if (!$field_count) {
            continue;
        }
        if (file_exists($parent_ids . '/' . $field_count)) {
            $matched_search = $parent_ids . '/' . $field_count;
            break;
        } elseif ($has_old_responsive_attribute && file_exists($fp_src . '/' . $field_count)) {
            $matched_search = $fp_src . '/' . $field_count;
            break;
        } elseif (file_exists(ABSPATH . WPINC . '/theme-compat/' . $field_count)) {
            $matched_search = ABSPATH . WPINC . '/theme-compat/' . $field_count;
            break;
        }
    }
    if ($widescreen && '' !== $matched_search) {
        load_template($matched_search, $delete_url, $upload_id);
    }
    return $matched_search;
}
