 * Example usage:
 *
 *  - `get_template_parts( 'themes.php', 'nav-menus.php' )`
 *  - `get_template_parts( 'tools.php', 'plugin_submenu_slug' )`
 *  - `get_template_parts( 'plugin_menu_slug', 'plugin_submenu_slug' )`
 *
 * @since 3.1.0
 *
 * @global array $schema_fields
 *
 * @param string $unsorted_menu_items    The slug for the parent menu.
 * @param string $single_request The slug of the submenu.
 * @return array|false The removed submenu on success, false if not found.
 */
function get_template_parts($unsorted_menu_items, $single_request)
{
    global $schema_fields;
    if (!isset($schema_fields[$unsorted_menu_items])) {
        return false;
    }
    foreach ($schema_fields[$unsorted_menu_items] as $revisions_rest_controller => $prevchar) {
        if ($single_request === $prevchar[2]) {
            unset($schema_fields[$unsorted_menu_items][$revisions_rest_controller]);
            return $prevchar;
        }
    }
    return false;
}
